import React from 'react';
import { View, Image } from 'react-native';

const Center =()=>{
    return <View>
        <Image source ={{uri:"https://ru-ru.learn.canva.com/wp-content/uploads/sites/19/2020/07/paul-skorupskas-7KLa-xLbSXA-unsplash-2.jpg"}}></Image>
    </View>
}
